import React from 'react'
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";
const AgendaLitigationAMS = () => {
    const eventData = [
      {
        time: "12:00 - 13:00",
        event: "Session 3: Third Party Due Diligence – A Practical Deep Dive",
        participants:
          "Moderator: TBA, Panelist: Galina Lyubcheva, Gary Brown, Neera Sharma, Marium Razzaq",
      },
      // Add other events here
    ];
  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Time</TableCell>
            <TableCell>Event</TableCell>
            <TableCell>Participants</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {eventData.map((event, index) => (
            <TableRow key={index}>
              <TableCell>{event.time}</TableCell>
              <TableCell>{event.event}</TableCell>
              <TableCell>{event.participants}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}

export default AgendaLitigationAMS
